Let $A$ and $B$ be two points lying on the parabola $y^2 = 4x$ in the first quadrant.  The circle with diameter $\overline{AB}$ has radius $r,$ and is tangent to the $x$-axis.  Find the slope of line $AB$ in terms of $r.$

[asy]
unitsize(0.4 cm);

path parab = (16,-8);
real y;
pair A, B, O;
real a, b, r;

a = (10 + 2*sqrt(5))/5;
b = (10 - 2*sqrt(5))/5;
A = (a^2,2*a);
B = (b^2,2*b);
O = (A + B)/2;
r = a + b;

for (y = -8; y <= 8; y = y + 0.2) {
  parab = parab--(y^2/4,y);
}

draw(parab,red);
draw((-2,0)--(16,0));
draw((0,-8)--(0,8));
draw(Circle(O,r));
draw(A--B);

dot("$A$", A, N);
dot("$B$", B, W);
[/asy]
